/*
 * Below is the process to generate the below static graph construction (first turn off word wrap):
 * 1. In graph_builder.update_graph_with_dex(...), add
 *    println("let tokens: Vec<Token> = vec!{:?};", tokens);
 *    println("let edges: Vec<ConstantProductAMMSwapEdge> = vec!{:?};", edges);
 * 2. cargo run --example privadex_build_visualize_graph --features=dot
 * 3. Normal string replace Dex { ... } with a reference to const Dex:
 *    From: Dex { id: Stellaswap, chain_id: SubstrateParachain(Polkadot, 2004), fee_bps: 25, graphql_url: "https://squid.subsquid.io/privadex-stellaswap/v/v0/graphql", eth_dex_router: 0x70085a09d30d6f8c4ecf6ee10120d1847383bb57 }
 *    To: &STELLASWAP
 *    From: Dex { id: Arthswap, chain_id: SubstrateParachain(Polkadot, 2006), fee_bps: 30, graphql_url: "https://squid.subsquid.io/privadex-arthswap/v/v0/graphql", eth_dex_router: 0xe915d2393a08a00c5a463053edd31bae2199b9e7 }
 *    To: &ARTHSWAP
 *    From: Dex { id: Beamswap, chain_id: SubstrateParachain(Polkadot, 2004), fee_bps: 30, graphql_url: "https://squid.subsquid.io/privadex-beamswap/v/v0/graphql", eth_dex_router: 0x96b244391d98b62d19ae89b1a4dccf0fc56970c7 }
 *    TO: &BEAMSWAP
 * 4. Regex replace hex addr strings for EthAddress:
 *    From: 0x([0-9a-f]+)
 *    To: EthAddress{0: hex!("$1")}
 * 5. Regex replace XC20{ ... } with XC20::from_asset_id(...)
 *    From: XC20Token \{ asset_id: ([0-9]+) \}
 *    To: XC20Token::from_asset_id($1)
 */

fn create_graph(token_edges: [(Vec<Token>, Vec<ConstantProductAMMSwapEdge>); 3], should_error: bool) -> Graph {
    let mut graph = Graph::new();

    // 1. Add ConstantProductAMMSwapEdges from each DEX (and connecting XC20, ERC20 vertices)
    for (tokens, edges) in token_edges.into_iter() {
        for token in tokens.into_iter() {
            let _ = graph.add_vertex(token);
        }
        for edge in edges.into_iter() {
            let res = graph.add_edge(Edge::Swap(SwapEdge::CPMM(edge)));
            if should_error {
                let _ = res.expect("Adding static CPMM edges should be error-free");
            }
        }
    }

    // 2. Add XCMBridgeEdges (and connecting XC20 vertices)
    for xcm_bridge in xcm_bridge_registry::XCM_BRIDGES.iter() {
        let _ = update_graph_with_xcm_bridge(xcm_bridge, &mut graph).unwrap();
    }

    // 3. Add WrapEdge and UnwrapEdge. We expect that the wrapped native ERC20 tokens is already
    // added to the graph, but Native tokens need not have been added (if the continue block
    // was hit in step 2)
    for chain_id in [ASTAR, MOONBEAM, POLKADOT].iter() {
        let res = update_graph_with_wrap_edges(chain_id, &mut graph);
        if should_error {
            let _ = res.expect("Adding static wrap/unwrap edges should be error-free");
        }
    }
    graph
}

